import { motion } from 'framer-motion'
function App() {
  const variants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1 },
  }


  return (
    <div className="App">
      <motion.div animate={{ scale: 0.5 }} />
      <motion.div
      initial="hidden"
      animate="visible"
      variants={variants}
      />
      <motion.div
      drag="x"
      dragConstraints={{ left: -100, right: 100 }}
      whileHover={{ scale: 1.1 }}
      whileTap={{ scale: 0.9 }}
      />
    </div>
  );
}

export default App;
